description:
Pool created for placing mysterious, yet beautiful and suggestive [[close-up|close-ups]] of various body parts. 
Pictures shouldn't show the character's face. However it is okay if it's only partial, or if the character is depicted in a completely separate panel.

Related tags: {{head_out_of_frame}}, {{close-up}}

[[Epic]] poses, awe-inspiring scenes, determination, strength and expressions that say "bring it on".

